            Relaciones = retVal.Relaciones;
            UbicacionEspecifica = retVal.UbicacionEspecifica;
            RFCHistoricos = retVal.RFCHistoricos;
            Patentes = retVal.Patentes;
            Sectores = retVal.Sectores;
            return retVal.RFC_Original;
        }
    }
}
